import React from 'react'
import Grid from '@material-ui/core/Grid';
import Padding from '../components/padding'
import { connect } from 'react-redux';
import TextField from '@material-ui/core/TextField';

class AddressComponent extends React.Component{

    state = this.props.formReducer.step1.address


    render(){
        console.log(this.state)
        return(
            <Grid container justify="center" direction="column" alignItems="center" spacing={5}>
                <Grid item xs={12}>
                    <h1 style={{color: '#084177'}}>Address Information</h1>
                </Grid>


                {
                      Object.keys(this.state).map(addr => (
                        <Grid key={addr} item xs={5} style={{width: '100%'}}>
                            <TextField 
                            style={{width: '100%'}}
                                label={addr.charAt(0).toUpperCase() + addr.substring(1,addr.length)} 
                                variant="outlined" 
                                value={this.state.addr} 

                            />
                        </Grid>
                      ))

                  }



            </Grid>
        )
    }
}

function mapStateToProps(state){
    return state;
}

export default connect(mapStateToProps)(AddressComponent);
